import React from "react"
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import notes from "./notes";

function App(){

    console.log(notes);

    return(
        <div>
        <Header/>
       { notes.map(function (x) {

          <Note title={x.title} msg={x.content} />
        })
        }
        <Footer/>
        </div>
    ) 
}

export default App
